(5, 1, '2021-06-21 12:00:11', '2021-06-21 09:00:11', '<label> Ваше имя*\r\n    [text* your-name] </label>\r\n\r\n<label> Ваша почта*\r\n    [email* your-email] </label>\r\n\r\n<label> Тема обращения\r\n    [text* your-subject] </label>\r\n\r\n<label> Ваше сообщение\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Submit\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wptester12345678@gmail.com>\nkiranto@tut.by\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <kiranto@tut.by>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nСпасибо, мы свяжемся с вами в кратчайшие сроки.\nПроизошла ошибка при отправке сообщения. Поробуйте еще раз\nОдно или более полей заполнены не правильно\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nНеобходимо заполнить все рекомендуемые поля\nThe field is too long.\nThe field is too short.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nФормат даты некорректен.\nВведённая дата слишком далеко в прошлом.\nВведённая дата слишком далеко в будущем.\nФормат числа некорректен.\nЧисло меньше минимально допустимого.\nЧисло больше максимально допустимого.\nНеверный ответ на проверочный вопрос.\nНеверно введён электронный адрес.\nВведён некорректный URL адрес.\nВведён некорректный телефонный номер.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2021-06-25 15:14:28', '2021-06-25 12:14:28', '', 0, 'http://localhost/?post_type=wpcf7_contact_form&#038;p=5', 0, 'wpc