(17, 1, '2021-06-22 16:17:53', '2021-06-22 13:17:53', '<!-- wp:paragraph -->\n<p>Waxom предоставляет услуги полного цикла по разработке, внедрению и сопровождению IT-решений. Мы разрабатываем функциональные веб-сайты, мобильные приложения, проектируем правильные интерфейсы, реализуем и автоматизируем сложные бизнес-процессы, и делаем это все красиво.</p>\n<!-- /wp:paragraph -->', 'Главная страница', '', 'publish', 'closed', 'closed', '', '%d0%b3%d0%bb%d0%b0%d0%b2%d0%bd%d0%b0%d1%8f-%d1%81%d1%82%d1%80%d0%b0%d0%bd%d0%b8%d1%86%d0%b0', '', '', '2021-06-24 11:22:41', '2021-06-24 08:22:41', '', 0, 'http://localhost/?page_id=17', 0, 'page', '', 0),
