(28, 1, '2021-06-24 10:46:53', '2021-06-24 07:46:53', '<!-- wp:paragraph -->\n<p><strong>Lorem Ipsum</strong> - это текст-\"рыба\", часто используемый в печати и вэб-дизайне. Lorem Ipsum является стандартной \"рыбой\" для текстов на латинице с начала XVI века. В то время некий безымянный печатник создал большую коллекцию размеров и форм шрифтов, используя Lorem Ipsum для распечатки образцов. Lorem Ipsum не только успешно пережил без заметных изменений пять веков, но и перешагнул в электронный дизайн. Его популяризации в новое время послужили публикация листов Letraset с образцами Lorem Ipsum в 60-х годах и, в более недавнее время, программы электронной вёрстки типа Aldus PageMaker, в шаблонах которых используется Lorem Ipsum.</p>\n<!-- /wp:paragraph -->', 'Услуги', '', 'publish', 'closed', 'closed', '', 'offers', '', '', '2021-06-24 11:33:48', '2021-06-24 08:33:48', '', 0, 'http://localhost/?page_id=28', 0, 'page', '', 0),
