(46, 1, '2021-06-24 11:22:41', '2021-06-24 08:22:41', '<!-- wp:paragraph -->\n<p>Waxom предоставляет услуги полного цикла по разработке, внедрению и сопровождению IT-решений. Мы разрабатываем функциональные веб-сайты, мобильные приложения, проектируем правильные интерфейсы, реализуем и автоматизируем сложные бизнес-процессы, и делаем это все красиво.</p>\n<!-- /wp:paragraph -->', 'Главная страница', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2021-06-24 11:22:41', '2021-06-24 08:22:41', '', 17, 'http://localhost/?p=46', 0, 'revision', '', 0),
(48, 1, '2021-06-24 11:28:21', '2021-06-24 08:28:21', '<!-- wp:heading -->\n<h2>Лидер в сфере web &amp; mobile разработки</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>15-лет мы предоставляем услуги полного цикла по разработке, внедрению и сопровождению IT-решений. Огромный опыт успешной работы с компаниями мирового уровня, независимые рейтинги, рекомендации и отзывы авторитетных компаний подтверждают наш высокий уровень.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Waxom лидирует в РейтингеРунета более чем в 10 номинациях по веб-разработке. По данным американского рейтингового агентства Clutch мы входим в Топ-250 веб-разработчиков в мире. В Рейтинге Байнета наша компания входит в Топ-3. Отмечены высокими местами в GoodFirms в статусе разработчика мобильных приложений и являемся партнерами WADLINE в Европе и MODx Professionals статус в Мире.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Waxom имеет аккредитацию Inc. Verified Business и D.U.N.S. Reristered Business статус, а также является членом Технопарка Sapiegos (Вильнюс, Литва). Компания является партнером конференций Стартап Года и MODxPo.<br>Веб-разработка, мобильные приложения, продвижение…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Полный комплекс услуг — бизнес-аналитика, проектирование, разработка любой сложности web &amp; mobile, брендинг, внедрение, продвижение, PR, IT-консалтинг</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Мы создали сотни проектов, среди которых успешные стартапы, сложные веб-сервисы и порталы, CRM и ERP системы, корпоративные веб-сайты, интернет-магазины и комплексные мобильные приложения.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Нами были организованы сотни рекламных кампаний и выведены в ТОП десятки тысяч поисковых запросов.<br>Клиенты<br>Samsung<br>Bayernkraft BMW<br>Трансимпериал<br>Mitsubishi Motors<br>Русский охотничий журнал<br>HG<br>HP<br>НОК Минск<br>Единая Хоккейная Лига<br>Абсолютбанк<br>Белнефтихим<br>Национальный Банк РБ</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Команда</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Наша команда состоит из опытных специалистов – это основополагающая ценность нашей компании. Каждый год мы совершенствуем технологии и программные решения. Мы идем в ногу со временем, постоянно инвестируя в ценные кадры, предлагая своим клиентам все более качественный и высокотехнологичный продукт.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Наша компания имеет огромный опыт в работе с клиентами со всего мира. Мы обеспечиваем полный контроль и прозрачность операций на всех этапах и гарантируем результат точно в срок и в полном объеме.</p>\n<!-- /wp:paragraph -->', 'Компания', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2021-06-24 11:28:21', '2021-06-24 08:28:21', '', 26, 'http://localhost/?p=48', 0, 'revision', '', 0),
